    "# Full model description: \n",
    "\n",
    "Decision variable = Coverage of each intervention i ($x_{i}$))\n",
    "\n",
    "**Objective:** $$ Maximise \\ \\sum\\limits _{i}(NHB_{i} \\times cases_{i} \\times x_{i})$$\n",
    "\n",
    "\n",
    "1. **Feasible coverage constraint:** \n",
    "$$0 <= x_{i} \\times cases_{i} <= MaxCoverage_{i} \\times cases_{i}, \\ \\forall i$$\n",
    "2. **Drug budget constraint:** \n",
    "$$\\sum\\limits _{i}(x_{i} \\times cases_{i} \\times DrugCost_{i}) < DrugBudget $$\n",
    "3. **Human Resource constraint: ** \n",
    "$$\\sum\\limits _{i}(x_{i} \\times cases_{i} \\times StaffTimeProportion_{i,j}) < StaffCount_{j}, \\ \\forall j$$\n",
    "4. **Substitute constraint: ** \n",
    "$$x_{1,k} \\times cases_{1,k} + x_{2,k} \\times cases_{2,k}  + ... <= \\max \\ (MaxCoverage_{1,k} \\times cases_{1,k}, \\ MaxCoverage_{2,k} \\times cases_{2,k}, ...) \\ \\forall k \\ substitute \\ groups \\ (where (1,k), (2,k),... are \\ substitute \\ interventions)$$\n",
    "5. **Compulsory interventions constraint:** (set to none in the base scenario)\n",
    "$$x_{c} = MaxCoverage_{c}, \\ \\forall compulsory \\  interventions, \\ c$$ "
   ]
