   "source": [
    "########################################################################################################\n",
    "# OUTPUT 2: Full table of primary results - Interventions, ICER, Solution_coverage, Total DALYs, Total drug cost, Total HR need\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "visible_cadres = c(1:3,6,7)\n",
    "# Base solution (with HR constraint)\n",
    "#-------------------------------------\n",
    "capture.output(\n",
    "    find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 0)\n",
    "    )\n",
    "base_objval <- solution.class$objval\n",
    "solution_cases <- solution * cases\n",
    "full_solution <- cbind.data.frame(category, intervention, solution, solution_cases, solution_dalysaverted, solution_drugexp, solution_hruse[,visible_cadres])\n",
    "\n",
    "colnames_soln = c(\"Program\", \"Intervention\", \"% of cases covered under optimal package\", \"Total number of cases covered under the optimal package\",\n",
    "                            \"DALYs averted\", \"Drug expenditure required\",\n",
    "                            \"Medical/Clinical Officer\", \"Nursing staff\",\n",
    "                            \"Pharmaceutical staff\",\n",
    "                            \"Mental health staff\", \"Nutrition staff\")\n",
    "colnames(full_solution) = colnames_soln\n",
    "\n",
    "write.csv(full_solution, file = \"outputs/tables/base_solution.csv\")\n",
    "\n",
    "# Base solution (with task shifting)\n",
    "#-------------------------------------\n",
    "capture.output(\n",
    "    find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 1)\n",
    "    )\n",
    "taskshift_objval <- solution.class$objval\n",
    "solution_cases <- solution * cases\n",
    "full_solution <- cbind.data.frame(category, intervention, solution, solution_cases, solution_dalysaverted, solution_drugexp, solution_hruse[,visible_cadres])\n",
    "\n",
    "colnames_soln = c(\"Program\", \"Intervention\", \"% of cases covered under optimal package\", \"Total number of cases covered under the optimal package\",\n",
    "                            \"DALYs averted\", \"Drug expenditure required\",\n",
    "                            \"Medical/Clinical Officer\", \"Nursing staff\",\n",
    "                            \"Pharmaceutical staff\",\n",
    "                            \"Mental health staff\", \"Nutrition staff\")\n",
    "colnames(full_solution) <- colnames_soln\n",
    "\n",
    "write.csv(full_solution, file = \"outputs/tables/base_solution_taskshifting.csv\")\n",
    "(taskshift_objval - base_objval)/base_objval"
   ]
