   "source": [
    "\n",
    "########################################################################################################\n",
    "# OUTPUT 3: Stacked bar charts showing resource use for the optimal versus full implementation scenario\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "# Full implementation scenario\n",
    "capture.output(\n",
    "find_optimal_package(data.frame = chosen_df , objective_input = 'nethealth', cet_input = no.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = no.drugbudget.limit, \n",
    "                     hr.scale = no.hr.limit, use_feasiblecov_constraint = 0, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 0)\n",
    ")\n",
    "gen_resourceuse_graphs(plot_title = \"Full implementation scenario\", file_name = \"outputs/figures/resourceuse_fullimplementation.pdf\")\n",
    "\n",
    "# All constraints scenario\n",
    "capture.output(\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 0)\n",
    ")\n",
    "gen_resourceuse_graphs(plot_title = \"Base scenario\", file_name = \"outputs/figures/resourceuse_base.pdf\")\n",
    "\n",
    "# All constraints scenario\n",
    "capture.output(\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = no.pharm.limit, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 0)\n",
    ")\n",
    "gen_resourceuse_graphs(plot_title = \"No pharmacist constraint\", file_name = \"outputs/figures/resourceuse_nopharmconstraint.pdf\")\n",
    "\n",
    "# Task shifting scenario\n",
    "capture.output(\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 1)\n",
    ")\n",
    "gen_resourceuse_graphs(plot_title = \"HR constraint with task shifting to nurses\", file_name = \"outputs/figures/resourceuse_taskshifting_both.pdf\")"
   ]
