    "capture.output(\n",
    "    find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = no.hr.limit, use_feasiblecov_constraint = 0, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 1)\n",
    "    )\n",
    "drugcons_dalys = solution * maxcoverage * cases * dalys\n",
    "drugcons_dalys = colSums(drugcons_dalys, na.rm = FALSE, dims = 1)\n",
    "newsolution_nethealth = solution * maxcoverage * cases * (dalys - fullcost/base.cet)\n",
    "newsolution_nethealth = colSums(newsolution_nethealth, na.rm = FALSE, dims = 1)\n",
    "\n",
    "print(paste('Net health loss(Rationing method 3) = ', optimal_nethealth - newsolution_nethealth, 'net DALYS',\n",
    "           '(', (optimal_nethealth - newsolution_nethealth)/optimal_nethealth * 100, '%)'))"
   ]
