   "source": [
    "########################################################################################################\n",
    "# OUTPUT X: Understanding the imapact of rationing (method 1)\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "# 1. Find the optimal package with no health system constraint\n",
    "capture.output(\n",
    "    find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = no.hr.limit, use_feasiblecov_constraint = 0, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 1)\n",
    "    )\n",
    "solution_drugcons <- solution\n",
    "# Note that task-shifting does not make a difference to the above\n",
    "\n",
    "# 1.i. Store the list of interventions in the above package in a list\n",
    "a <- which(solution > 0)\n",
    "suboptimal_hbp <- intcode[a]\n",
    "\n",
    "# 2.  Find the optimal package with all constraints and the interventions from the previous package made compulsory\n",
    "# % Find a way to make the process of arriving that the highest feaisble value of compcov_scale automatic\n",
    "    find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                         drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                         hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 0.715,\n",
    "                         compulsory_interventions = suboptimal_hbp, substitutes = subs_list, task_shifting_pharm = 1)\n",
    "suboptimal_nethealth <- solution.class$objval\n",
    "solution_suboptimal <- solution\n",
    "gen_resourceuse_graphs(plot_title = \"Resource use under suboptimal rationing\", file_name = \"outputs/figures/resourceuse_suboprationing_m1.pdf\")\n",
    "\n",
    "# 3. Find the health loss due to optimising without considering health system constraints\n",
    "capture.output(\n",
    "    find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                         drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                         hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                         compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 1)\n",
    "    )\n",
    "solution_optimal <- solution\n",
    "optimal_nethealth <- solution.class$objval\n",
    "\n",
    "health_loss <- optimal_healthimpact - suboptimal_healthimpact\n",
    "print(paste(\"Health loss (net DALYs lost)\", health_loss))\n",
    "print(paste(\"Health loss ($)\", health_loss*base.cet))\n"
   ]
  },
