   "source": [
    "########################################################################################################\n",
    "# OUTPUT X: Understanding the impaact of rationing (method 2)\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "\n",
    "# 1. Find the optimal package with no health system constraint\n",
    "capture.output(\n",
    "    find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = no.hr.limit, use_feasiblecov_constraint = 0, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = 1)\n",
    "    )\n",
    "# Note that task-shifting does not make a difference to the above\n",
    "\n",
    "# 2.Scale down HR use for the above infeasible solution to max level\n",
    "solution_hruse_long <- unlist(solution_hr) * unlist(cons_hr)\n",
    "solution_hruse_scaled <- solution_hruse_long\n",
    "for (i in 1:length(hruse.prop)){\n",
    "    if (hruse.prop[,i] > 1){\n",
    "        print(i)\n",
    "        solution_hruse_scaled[,i] <- solution_hruse_long[,i]/hruse.prop[,i]\n",
    "    }\n",
    "}\n",
    "\n",
    "## Verification\n",
    "total_hruse_scaled <<- colSums(solution_hruse_scaled, na.rm = FALSE, dims = 1) # Number of minutes per health worker cadre utlitised by the optimal solution\n",
    "hruse.prop_scaled <<- round(total_hruse_scaled/cons_hr.limit_base, 2)\n",
    "hruse.prop_scaled # verify that hruse_prop does not exceed 1\n",
    "##\n",
    "\n",
    "# 3. Re-calculate solution coverage values based on the above HR use estimate\n",
    "\n",
    "scaledsolution <- unlist(solution_hruse_scaled)/unlist(cons_hr)\n",
    "scaledsolution[is.na(scaledsolution)] = 99\n",
    "scaledsolution <- apply(scaledsolution, 1, FUN = function(x) {min(x[x > 0])})\n",
    "scaledsolution[scaledsolution == 99] = 0\n",
    "\n",
    "# 5. Calculate HR use in the above scaled solution\n",
    "solution_hruse <<- unlist(scaledsolution) * cons_hr\n",
    "\n",
    "# Collapse solution by intervention \n",
    "for (i in 1:length(dalys)){\n",
    "  for (j in 1:(reps-1)){\n",
    "      scaledsolution[i] <- scaledsolution[i] + scaledsolution[i+length(dalys)*j]\n",
    "  }\n",
    "}\n",
    "scaledsolution <- as.data.frame(scaledsolution[1:length(dalys)])\n",
    "\n",
    "# 4. Calculate health impact of the above scaled solution\n",
    "scaledsolution_dalysaverted <- scaledsolution * cases * dalys\n",
    "scaledsolution_dalysaverted <- colSums(scaledsolution_dalysaverted, na.rm = FALSE, dims = 1)\n",
    "scaledsolution_dalysaverted\n",
    "\n",
    "scaledsolution_nethealth <- scaledsolution * cases * (dalys-fullcost/base.cet)\n",
    "scaledsolution_nethealth <- colSums(scaledsolution_nethealth, na.rm = FALSE, dims = 1)\n",
    "scaledsolution_nethealth\n",
    "\n",
    "# 6. Calculate the drug expenditure in the above scaled solution\n",
    "solution_drugexp <<- scaledsolution * cons_drug[1:length(dalys)]\n",
    "\n",
    "gen_resourceuse_graphs(plot_title = \"Resource use under suboptimal rationing\", file_name = \"outputs/figures/resourceuse_suboprationing_m2.pdf\")"
   ]
  },
