    "drugcons_vs_rationing <- abs(solution_drugcons - solution_suboptimal) <= solution_suboptimal * 0.001\n",
    "rationing_vs_optimal <- abs(solution_optimal - solution_suboptimal) <= solution_suboptimal * 0.001\n",
    "scaledsolution_vs_rationing <- abs(solution_suboptimal - scaledsolution) <= solution_suboptimal * 0.001\n",
    "#solution_optimal\n",
    "# Merge intervention code and intervention\n",
    "\n",
    "rationing_comparison = cbind.data.frame(category, intervention, \n",
    "                                        solution_drugcons, solution_suboptimal, scaledsolution, solution_optimal, \n",
    "                                        drugcons_vs_rationing, scaledsolution_vs_rationing, rationing_vs_optimal)\n",
    "colnames(rationing_comparison) = c('Program', 'Intervention', 'Coverage - only drug constraint',\n",
    "                                  'Coverage - Rationing', 'Coverage - Rationing_method2', 'Coverage - Optimal', 'Comparison - Drug constraint vs Rationing',\n",
    "                                  'Comparison - Rationing_method2 vs Rationing', 'Comparison - Rationing vs Optimal')\n",
    "print(paste('Net health loss(Rationing method 1) = ', optimal_nethealth - suboptimal_nethealth, 'net DALYS', \n",
    "            '(', (optimal_nethealth - suboptimal_nethealth)/optimal_nethealth * 100, '%)'))\n",
    "print(paste('Net health loss(Rationing method 2) = ', optimal_nethealth - scaledsolution_nethealth, 'net DALYS',\n",
    "           '(', (optimal_nethealth - scaledsolution_nethealth)/optimal_nethealth * 100, '%)'))\n",
    "print(paste('Net health loss(Rationing method 3) = ', optimal_nethealth - newsolution_nethealth, 'net DALYS',\n",
    "           '(', (optimal_nethealth - newsolution_nethealth)/optimal_nethealth * 100, '%)'))\n",
    "write.csv(rationing_comparison, file = \"outputs/tables/rationing_comparison.csv\") \n",
    "optimal_nethealth"
   ]
