    "task_shifting_yn = 1\n",
    "pharm_scale = 1\n",
    "# i. Base solution\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "base_cons_hr <- cons_hr.limit.saved\n",
    "nhb_base <- solution.class$objval\n",
    "solution_base <- solution\n",
    "\n",
    "prop_1nutri = 1/ cons_hr.limit.saved[,7] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,1,1,1,1+prop_1nutri,1), \n",
    "                     use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1nutri <- solution.class$objval \n",
    "annual_salary_nutri <- 166*12\n",
    "value_1nutri <- (nhb_1nutri - nhb_base)/annual_salary_nutri\n",
    "\n",
    "value_1nutri * 1000\n",
    "64734285.3208663 - 64734224.0306392\n",
    "(64734285.3208663 - 64734224.0306392)/annual_salary_nutri\n",
    "1/((64734285.3208663 - 64734224.0306392)/annual_salary_nutri)\n",
    "nhb_1nutri - nhb_base\n",
    "(166*12)"
   ]
