   "source": [
    "########################################################################################################\n",
    "# OUTPUT [Global Fund]: Marginal value of relaxing feaisble coverage constraints\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "# i. Base solution\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "base_cons_hr <- cons_hr.limit.saved\n",
    "nhb_base <- solution.class$objval\n",
    "\n",
    "# ii. Feasible coverage constraints relaxed by 25%\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1, feascov_scale = 1.25, compcov_scale = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_feascovrelaxed <- solution.class$objval \n",
    "\n",
    "# Estimate the value\n",
    "value_feascovrelaxed <- (nhb_feascovrelaxed - nhb_base)\n",
    "value_feascovrelaxed"
   ]
  },
