    "########################################################################################################\n",
    "# OUTPUT 4b: Marginal value graph for different HS components - with task shifting\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "task_shifting_yn = 1\n",
    "pharm_scale = 1\n",
    "# i. Base solution\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "base_cons_hr <- cons_hr.limit.saved\n",
    "nhb_base <- solution.class$objval\n",
    "solution_base <- solution\n",
    "\n",
    "# i. Shadow price of medical staff\n",
    "prop_1med = 1/ cons_hr.limit.saved[,1] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, hr.scale = c(1+prop_1med,1,pharm_scale,rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1med <- solution.class$objval\n",
    "annual_salary_med <- 567*12\n",
    "value_1med <- (nhb_1med - nhb_base)/annual_salary_med\n",
    "\n",
    "print(paste(\"The marginal productivity of every $ spent on a medical officer's salary is\", value_1med/annual_salary_med, \" DALYs\"))\n",
    "\n",
    "# ii.a Shadow price of nurses\n",
    "# Method one: Marginal\n",
    "prop_1nurse = 1/ cons_hr.limit.saved[,2] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, hr.scale = c(1,1 + prop_1nurse,pharm_scale, rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1nurse <- solution.class$objval\n",
    "annual_salary_nurse <- 166*12\n",
    "value_1nurse <- (nhb_1nurse - nhb_base)/annual_salary_nurse\n",
    "\n",
    "print(paste(\"(Marginal method) The marginal productivity an additional $ spent on a nurse's salary is\", value_1nurse/annual_salary_nurse, \" DALYs\"))\n",
    "\n",
    "# Method two: Non-marginal (This is only for comparison)\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1.01,pharm_scale, rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_nurse_1perc <- solution.class$objval\n",
    "value_1nurse_nonmarginal <- ((nhb_nurse_1perc - nhb_base)/(cons_hr.limit.saved[2]-base_cons_hr[2]))/annual_salary_nurse\n",
    "\n",
    "# divide salary of a nurse by the change in NHB --> marginal productivity of a nurse (per dollar spent on salary)\n",
    "print(paste(\"(Non-marginal method) The marginal productivity an additional $ spent on a nurse's salary is\", value_1nurse_nonmarginal/annual_salary_nurse, \" DALYs\"))\n",
    "\n",
    "# iii. Shadow price of pharmacists\n",
    "prop_1pharm = 1/ (cons_hr.limit.saved[,3] * pharm_scale)\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale+prop_1pharm,rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1pharm <- solution.class$objval\n",
    "annual_salary_pharm <- 230*12\n",
    "value_1pharm <- (nhb_1pharm - nhb_base)/annual_salary_pharm\n",
    "\n",
    "print(paste(\"The marginal productivity of an additional $ spent on a pharmacist's salary is\", value_1pharm/annual_salary_pharm, \" DALYs\"))\n",
    "\n",
    "\n",
    "# iv. Shadow price of lab staff\n",
    "prop_1lab = 1/ cons_hr.limit.saved[,4] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,1+prop_1lab,rep(1,4)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1lab <- solution.class$objval\n",
    "annual_salary_lab <- 230*12\n",
    "value_1lab <- (nhb_1lab - nhb_base)/annual_salary_lab\n",
    "\n",
    "# v. Shadow price of mental health officers\n",
    "prop_1mental = 1/ cons_hr.limit.saved[,6] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,1,1,1+prop_1mental,1,1), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1mental <- solution.class$objval\n",
    "annual_salary_mental <- 230*12\n",
    "value_1mental <- (nhb_1mental - nhb_base)/annual_salary_mental\n",
    "\n",
    "# vi. Shadow price of nutrition officers\n",
    "prop_1nutri = 1/ cons_hr.limit.saved[,7] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,1,1,1,1+prop_1nutri,1), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1nutri <- solution.class$objval\n",
    "annual_salary_nutri <- 166*12\n",
    "value_1nutri <- (nhb_1nutri - nhb_base)/annual_salary_nutri\n",
    "\n",
    "# vii Shadow price of drug budget\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget + 1, drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1drug <- solution.class$objval\n",
    "value_1drug <- (nhb_1drug - nhb_base)\n",
    "\n",
    "\n",
    "print(\"MARGINAL PRODUCTIVITY IN DALYS OF 1000 DOLLARS SPENT ON ...\")\n",
    "print(\"#####################################\")\n",
    "\n",
    "shadowprice_table = rbind(value_1drug, value_1med, value_1nurse, value_1pharm, value_1lab, value_1mental, value_1nutri)\n",
    "shadowprice_table = round(shadowprice_table*1000,2)\n",
    "\n",
    "hs_components = c('Drug budget', 'Doctor/Medical officer time', 'Nurse time', 'Pharmacist time', 'Lab officer time', 'Mental Health officer time', 'Nutrition officer time')\n",
    "#jpeg(\"ouputs/marginalvalue_hss.jpg\", width = 500, height = 500)\n",
    "pdf(\"outputs/figures/marginalvalue_hss_ts.pdf\")\n",
    "par(mar=c(4,11,4,4))\n",
    "y <- barplot(height = rev(t(shadowprice_table)), names = rev(hs_components), width = 1 ,\n",
    "        space=NULL, las = 1, horiz=T,\n",
    "        xlim=c(0,4000), ylab = \"\", xlab = \"Net Health Benefit (DALYs)\",\n",
    "        main=\"Marginal value of $1000 spent on Health systems components\")\n",
    "#text(y, 0, round(rev(t(shadowprice_table)),2),cex=1, pos=1)\n",
    "x <-as.matrix(rev(t(shadowprice_table)))\n",
    "text(x+400,y,labels=as.character(round(x,3)))\n",
    "dev.off()"
   ]
  },
