    "########################################################################################################\n",
    "# OUTPUT 4c: Marginal value of health workers - assuming task shifting\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "task_shifting_yn = 1\n",
    "pharm_scale = 1\n",
    "# i. Base solution\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, \n",
    "                     hr.scale = base.hr, use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "base_cons_hr <- cons_hr.limit.saved\n",
    "nhb_base <- solution.class$objval\n",
    "solution_base <- solution\n",
    "\n",
    "# i. Shadow price of medical staff\n",
    "prop_1med = 1 / cons_hr.limit.saved[,1] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, hr.scale = c(1+prop_1med,1,pharm_scale,rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1med <- solution.class$objval\n",
    "reserveprice_1med <- (nhb_1med - nhb_base) * base.cet\n",
    "\n",
    "print(paste(\"The marginal productivity of every $ spent on a medical officer's salary is\", value_1med/annual_salary_med, \" DALYs\"))\n",
    "\n",
    "# ii.a Shadow price of nurses\n",
    "# Method one: Marginal\n",
    "prop_1nurse = 1/ cons_hr.limit.saved[,2] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, hr.scale = c(1,1 + prop_1nurse,pharm_scale, rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1nurse <- solution.class$objval\n",
    "reserveprice_1nurse <- (nhb_1nurse - nhb_base) * base.cet\n",
    "\n",
    "print(paste(\"(Marginal method) The marginal productivity an additional $ spent on a nurse's salary is\", value_1nurse/annual_salary_nurse, \" DALYs\"))\n",
    "\n",
    "# iii. Shadow price of pharmacists\n",
    "prop_1pharm = 1/ (cons_hr.limit.saved[,3] * pharm_scale)\n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale+prop_1pharm,rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1pharm <- solution.class$objval\n",
    "reserveprice_1pharm <- (nhb_1pharm - nhb_base)* base.cet\n",
    "\n",
    "# iv. Shadow price of lab staff\n",
    "prop_1lab = 1/ cons_hr.limit.saved[,4] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,1+prop_1lab,rep(1,4)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1lab <- solution.class$objval\n",
    "reserveprice_1lab <- (nhb_1lab - nhb_base)* base.cet\n",
    "\n",
    "# v. Shadow price of mental health officers\n",
    "prop_1mental = 1/ cons_hr.limit.saved[,6] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,1,1,1+prop_1mental,1,1), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1mental <- solution.class$objval\n",
    "reserveprice_1mental <- (nhb_1mental - nhb_base)* base.cet\n",
    "\n",
    "# vi. Shadow price of nutrition officers\n",
    "prop_1nutri = 1/ cons_hr.limit.saved[,7] \n",
    "find_optimal_package(data.frame = chosen_df, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget,  drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,1,1,1,1+prop_1nutri,1), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list, task_shifting_pharm = task_shifting_yn)\n",
    "nhb_1nutri <- solution.class$objval\n",
    "reserveprice_1nutri <- (nhb_1nutri - nhb_base)* base.cet\n",
    "\n",
    "\n",
    "print(\"RESERVATION PRICE FOR A YEAR'S WORTH OF HEALTH WORKER TIME ...\")\n",
    "print(\"#####################################\")\n",
    "\n",
    "reserveprice_table = rbind(reserveprice_1med, reserveprice_1nurse, reserveprice_1pharm, reserveprice_1lab, reserveprice_1mental, reserveprice_1nutri)\n",
    "reserveprice_table = round(reserveprice_table,2)\n",
    "\n",
    "hs_components = c('Doctor/Medical officer time', 'Nurse time', 'Pharmacist time', 'Lab officer time', 'Mental Health officer time', 'Nutrition officer time')\n",
    "#jpeg(\"ouputs/marginalvalue_hss.jpg\", width = 500, height = 500)\n",
    "\n",
    "reserveprice_table"
   ]
