   "source": [
    "########################################################################################################\n",
    "# OUTPUT 3: Summary NHB Graph (Bookshelf) - To be fixed\n",
    "#--------------------------------------------------------------------------------------------------------------\n",
    "########################################################################################################\n",
    "pharm_scale = 1\n",
    "# 1. Base solution\n",
    "capture.output(\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, drug_budget.scale = 1, hr.scale = c(1,1,pharm_scale,rep(1,5)), use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = NULL, substitutes = subs_list)\n",
    ")\n",
    "solution_cases <- solution * cases\n",
    "dalysper1000 <- dalys/fullcost * 1000\n",
    "\n",
    "# Define colours for the graphs\n",
    "blue <- rgb(0, 0, 1, alpha=0.5)\n",
    "red <- rgb(1, 0, 0, alpha=0.5)\n",
    "\n",
    "solution_cases <- as.numeric(as.matrix(solution_cases))\n",
    "nethealth <- as.numeric(as.matrix(nethealth))\n",
    "dalysper1000 <- as.numeric(as.matrix(dalysper1000))\n",
    "solution_drugexp <- as.numeric(as.matrix(solution_drugexp))\n",
    "\n",
    "#grph.data_full <- as.data.frame(cbind(base_cases, nethealth, new_df$intcode))\n",
    "yaxisvariable <- dalysper1000\n",
    "grph.data_full  <- cbind.data.frame(solution_cases, nethealth, dalysper1000,solution_drugexp, intcode)\n",
    "grph.data_full = grph.data_full[order(grph.data_full$dalysper1000, decreasing = TRUE),]\n",
    "range= 1:20\n",
    "barplot(height = grph.data_full$dalysper1000[range], names = grph.data_full$intcode[range], width = grph.data_full$solution_drugexp[range],space=0, col = blue, xlab = \"Cumulative consumables expenditure\", ylab = \"DALYs averted per $1000\")\n",
    "\n",
    "range= 21:120\n",
    "barplot(height = grph.data_full$dalysper1000[range], names = grph.data_full$intcode[range], width = grph.data_full$solution_drugexp[range],space=0, col = blue, xlab = \"Cumulative consumables expenditure\", ylab = \"DALYs averted per $1000\")"
   ]
