    "##########################################################\n",
    "# 3d - Scenarios including donor or govt. constraints/compulsory interventions\n",
    "##########################################################\n",
    "# 1. Solution with ART included\n",
    "#------------------------------\n",
    "art = c(\"139\",\"140\")\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, hr.scale = base.hr, use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = art, substitutes = subs_list)\n",
    "nhb_art <- solution.class$objval\n",
    "loss_art <- nhb_base - nhb_art\n",
    "print(paste(\"Reduction in NHB due to compulsory inclusion of ART = \", loss_art))\n",
    "scen8 = cbind.data.frame(pos_nethealth.count, intervention.count, dalys_averted, cet_soln, drug_exp.prop, t(hruse.prop[,visible_cadres]))\n",
    "\n",
    "# 2. Solution with all HIV/TB/Malaria interventions included\n",
    "#-------------------------------------------------------------\n",
    "hiv = c(\"037\", \"038\", \"043\", \"044\", \"120\", \"132\", \"134\", \"135\", \"137\", \"138\", \"139\", \"140\", \"149\", \"321\")\n",
    "# Between viral load and CD4 tests, only CD4 was included\n",
    "# Between \"ART (Second-Line Treatment) for adults without intensive monitoring\", \"ART (Second-Line Treatment) for adults with intensive monitoring\", only the former was included because of lower negative NHB (i.e. higher NHB)\n",
    "malaria = c(\"063\", \"071\", \"090\", \"093\")\n",
    "# Note that \"059 - ITN distribution to pregnant women\", \"061 - IPT for pregnant women\" are already part of the Basic ANC combination\n",
    "tb = c(\"095\", \"096\", \"097\", \"106\", \"110\", \"316\") \n",
    "# Between \"First line treatment of smear positive cases (95% coverage)\", \"Full DOTS (smear-positive, smear negative and Extrapulmonary cases)\", \"Full combination DOTS  (smear-positive, smear negative, extrapulmonary cases, MDR cases)\", only the last one was included\n",
    "# Between \"Xpert test (Full)\", \"Xpert test (targeted)\", only the first one was included\n",
    "\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'nethealth', cet_input = base.cet, \n",
    "                     drug_budget_input = base.drugbudget, hr.scale = base.hr, use_feasiblecov_constraint = 1,\n",
    "                     compulsory_interventions = c(hiv,tb,malaria), substitutes = subs_list)## No solution so the following code is not valid\n",
    "nhb_fulldonor <- solution.class$objval\n",
    "loss_fulldonor <- nhb_base - nhb_art\n",
    "print(paste(\"Reduction in NHB due to compulsory inclusion of malaria, HIV and TB interventions = \", loss_fulldonor))\n",
    "\n",
    "\n",
    "# % Check what proportion of drug budget and staff capacity is used by just the donor supported interventions %\n",
    "donor_ints <- c(hiv ,tb, malaria)\n",
    "df_donor <- new_df[new_df$intcode %in% donor_ints,]\n",
    "# drug expenditure\n",
    "drugexp_donor.interventions <- df_donor$maxcoverage * df_donor$cases * df_donor$drugcost/base.drugbudget * 100\n",
    "cbind(df_donor$category, df_donor$intcode, drugexp_donor.interventions)\n",
    "# %% Question - Is 20,000,000 target for HIV testing too high and $14 per test\n",
    "\n",
    "drugexp_donor.interventions.sum <- sum(unlist(lapply(df_donor$maxcoverage * df_donor$cases * df_donor$drugcost, sum)))\n",
    "print(paste(\"The drug costs of HIV, TB, and Malaria interventions are \", drugexp_donor.interventions.sum/base.drugbudget * 100, \"% of the drug budget\"))\n",
    "\n",
    "# HR need\n",
    "df_donor$medstaff = ((df_donor$hr1 + df_donor$hr2 + df_donor$hr3) * df_donor$maxcoverage * df_donor$cases) / medstaffmins.limit *100\n",
    "df_donor$nursingstaff = ((df_donor$hr4+ df_donor$hr5) * df_donor$maxcoverage * df_donor$cases) /nursingstaffmins.limit * 100\n",
    "df_donor$pharmstaff = ((df_donor$hr6 + df_donor$hr7 + df_donor$hr8) * df_donor$maxcoverage * df_donor$cases)/pharmstaffmins.limit * 100\n",
    "df_donor$labstaff = ((df_donor$hr9 + df_donor$hr10 + df_donor$hr11) * df_donor$maxcoverage * df_donor$cases)/labstaffmins.limit * 100\n",
    "\n",
    "cbind(df_donor$category, df_donor$intcode, df_donor$medstaff, df_donor$nursingstaff, df_donor$pharmstaff, df_donor$labstaff)\n",
    "\n",
    "print(paste(\"Medical staff capacity used = \", sum(unlist(lapply(df_donor$medstaff, sum)))))\n",
    "print(paste(\"Nursing capacity used = \", sum(unlist(lapply(df_donor$nursingstaff, sum)))))\n",
    "print(paste(\"Pharmacist capacity used = \", sum(unlist(lapply(df_donor$pharmstaff, sum)))))\n",
    "print(paste(\"Lab staff capacity used = \", sum(unlist(lapply(df_donor$labstaff, sum)))))\n",
    "\n",
    "# \\% of interventions with negative NHB\n",
    "print(paste(\"Percetage of interventions with negative NHB\",\n",
    "            nrow(subset(df_donor, nethealth_tmp <0))/length(df_donor) * 100))"
   ]
  },
