    "##########################################################\n",
    "# 3e - Scenarios for the derivation of CET\n",
    "##########################################################\n",
    "\n",
    "# 1. Locating the CET at the point when the any constraint is exhausted\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'dalys', cet_input = no.cet, drug_budget_input = base.drugbudget, hr.scale = base.hr.limit, compulsory_interventions = NULL, substitutes = subs_list)\n",
    "icer <- fullcost/dalys\n",
    "temp <- cbind(icer, solution, new_df$intervention)\n",
    "cet_derived <- max(temp$icer[temp$solution > 0]) # 2139\n",
    "a <- which(icer == max(temp$icer[temp$solution > 0])) # to check which included intervention has the highest ICER\n",
    "least.ce.intervention <- new_df$intervention[a]\n",
    "print(paste(\"The CET based on the drug budget constraint (with HR constraint) is\", cet_derived,\n",
    "            \";  The least cost-effective intervention in the package is\", least.ce.intervention))\n",
    "\n",
    "# 1. Locating the CET at the point when the drug budget is exhausted\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'dalys', cet_input = no.cet, drug_budget_input = base.drugbudget, hr.scale = c(1,1,1,1), compulsory_interventions = NULL, substitutes = subs_list)\n",
    "icer <- fullcost/dalys\n",
    "temp <- cbind(icer, solution, new_df$intervention)\n",
    "cet_derived <- max(temp$icer[temp$solution > 0]) # 2139\n",
    "a <- which(icer == max(temp$icer[temp$solution > 0])) # to check which included intervention has the highest ICER\n",
    "least.ce.intervention <- new_df$intervention[a]\n",
    "print(paste(\"The CET based on the drug budget constraint (with no HR constraint) is\", cet_derived,\n",
    "            \";  The least cost-effective intervention in the package is\", least.ce.intervention))\n",
    "\n",
    "# 2. Locating the CET at the point when the nurse capacity is exhausted\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'dalys', cet_input = no.cet, drug_budget_input = no.drugbudget.limit, hr.scale = only.nurse.limit, compulsory_interventions = NULL, substitutes = subs_list)\n",
    "icer <- fullcost/dalys\n",
    "temp <- cbind(icer, solution, new_df$intervention)\n",
    "cet_derived <- max(temp$icer[temp$solution > 0])\n",
    "a <- which(icer == max(temp$icer[temp$solution > 0])) # to check which included intervention has the highest ICER\n",
    "least.ce.intervention <- new_df$intervention[a]\n",
    "print(paste(\"The CET based on the Nurse capacity constraint (with no other HR constraint or drug constraint) is\", cet_derived,\n",
    "            \";  The least cost-effective intervention in the package is\", least.ce.intervention))\n",
    "\n",
    "# 3. Locating the CET at the point when the pharmacist capacity is exhausted\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'dalys', cet_input = no.cet, drug_budget_input = no.drugbudget.limit, hr.scale = only.pharm.limit, compulsory_interventions = NULL, substitutes = subs_list)\n",
    "icer <- fullcost/dalys\n",
    "temp <- cbind(icer, solution, new_df$intervention)\n",
    "cet_derived <- max(temp$icer[temp$solution > 0]) \n",
    "a <- which(icer == max(temp$icer[temp$solution > 0])) # to check which included intervention has the highest ICER\n",
    "least.ce.intervention <- new_df$intervention[a]\n",
    "print(paste(\"The CET based on the Pharmacist capacity constraint (with no other HR constraint or drug constraint) is\", cet_derived,\n",
    "            \";  The least cost-effective intervention in the package is\", least.ce.intervention))"
   ]
