   "source": [
    "# 1. Locating the CET at the point when the any constraint is exhausted\n",
    "find_optimal_package(data.frame = df.nocomplements, objective_input = 'nethealth', cet_input = 500, drug_budget_input = 99999999999999999, hr.scale = no.hr.limit, compulsory_interventions = NULL, substitutes = subs_list)\n",
    "icer <- fullcost/dalys\n",
    "temp <- cbind(icer, solution, new_df$intervention)\n",
    "cet_derived <- max(temp$icer[temp$solution > 0]) # 2139\n",
    "a <- which(icer == max(temp$icer[temp$solution > 0])) # to check which included intervention has the highest ICER\n",
    "least.ce.intervention <- new_df$intervention[a]\n",
    "print(paste(\"The CET based on the drug budget constraint (with HR constraint) is\", cet_derived,\n",
    "            \";  The least cost-effective intervention in the package is\", least.ce.intervention))"
   ]
  },
